import React from "react";
import style from "./faq.module.css";
import Link from "next/link";

const Fraq = (props) => {
  return (
    <section>
      <div className={style.containerFaq}>
        <div className={style.box}>
          <img src="botsOne.png" />
        </div>
        <div className={style.box}>
          <img src="botsTwo.png" />
        </div>
        <div className={style.box}>
          <img src="botsThree.png" />
        </div>
      </div>
    </section>
  );
};

export default Fraq;
